import React, { Component } from "react";

class wordListContainer extends Component {
    constructor(props){
        super(props)
    }

    render(){
        const wordArray = [
            wordObject,
            wordObjectTwo
        ]

        const wordObject = {
            word: "Dog",
            type: "Noun",
            category: "Animal",
            difficulty: "Easy"
        }

        const wordObjectTwo = {
            word: "Tree",
            type: "Noun",
            category: "Plant",
            difficulty: "Easy"
        }



        return(
            <div>
                <p>The word is:</p>
                <ul>
                    <li>{wordArray[0].word}</li>
                    <li>{wordArray[0].type}</li>
                    <li>{wordArray[0].category}</li>
                    <li>{wordArray[0].difficulty}</li>
                </ul>
            </div>
        )
    }
}

export default wordListContainer;

